describe("Endnote reference character validation", () => {
    let editor: DocumentEditor = undefined;
    beforeAll(() => {
        document.body.innerHTML = '';
        let ele: HTMLElement = createElement('div', { id: 'container' });
        document.body.appendChild(ele);
        DocumentEditor.Inject(Editor, Selection, EditorHistory);
        editor = new DocumentEditor({ enableEditor: true, isReadOnly: false, enableEditorHistory: true });
        (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
        (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
        (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
        (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
        editor.appendTo('#container');
    });
    afterAll((done) => {
        editor.destroy();
        document.body.removeChild(document.getElementById('container'));
        editor = undefined;
        document.body.innerHTML = '';
        setTimeout(() => {
            done();
        }, 750);
    });
    it('Endnote character validation', () => {
        console.log('Endnote character validation');
        editor.editor.insertText('Adventure Works Cycles, the fictitious company');
        editor.editor.insertEndnote();
        editor.editor.insertText('One');
        editor.selection.moveToDocumentEnd();
        editor.editor.insertText('on which the Adventure Works sample databases are based');
        editor.editor.insertEndnote();
        editor.editor.insertText('Two');
        editor.selection.moveToDocumentEnd();
        editor.editor.insertText('is a large, multinational manufacturing company.');
        editor.editor.insertEndnote();
        editor.editor.insertText('Three');
        editor.selection.moveToDocumentEnd();

        let bodyWidget1: BodyWidget = editor.documentHelper.pages[0].endnoteWidget.bodyWidgets[1].childWidgets[0] as BodyWidget;
        let paragraph1: LineWidget = bodyWidget1.childWidgets[0] as LineWidget;
        let text1: TextElementBox = paragraph1.children[0] as TextElementBox;
        expect(text1.text).not.toBe('?');
        expect(text1.text).toBe(editor.documentHelper.endnoteCollection[1].text);

        editor.editor.handleBackKey();
        editor.editor.insertEndnote();
        editor.editor.insertText('Four');
        editor.selection.moveToDocumentStart();

        let bodyWidget2: BodyWidget = editor.documentHelper.pages[0].endnoteWidget.bodyWidgets[2].childWidgets[0] as BodyWidget;
        let paragraph2: LineWidget = bodyWidget2.childWidgets[0] as LineWidget;
        let text2: TextElementBox = paragraph2.children[0] as TextElementBox;
        expect(text2.text).not.toBe('?');
        expect(text2.text).toBe(editor.documentHelper.endnoteCollection[2].text);

        editor.editor.insertEndnote();
        editor.editor.insertText('Five');

        let bodyWidget3: BodyWidget = editor.documentHelper.pages[0].endnoteWidget.bodyWidgets[0].childWidgets[0] as BodyWidget;
        let paragraph3: LineWidget = bodyWidget3.childWidgets[0] as LineWidget;
        let text3: TextElementBox = paragraph3.children[0] as TextElementBox;
        expect(text3.text).not.toBe('ii');
        expect(text3.text).toBe(editor.documentHelper.endnoteCollection[0].text);
    });
});

