describe("Endnote on two page", () => {
    let editor: DocumentEditor = undefined;
    beforeAll(() => {
        document.body.innerHTML = '';
        let ele: HTMLElement = createElement('div', { id: 'container' });
        document.body.appendChild(ele);
        DocumentEditor.Inject(Editor, Selection, EditorHistory);
        editor = new DocumentEditor({ enableEditor: true, isReadOnly: false, enableEditorHistory: true });
        (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
        (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
        (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
        (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
        editor.appendTo('#container');
    });
    afterAll((done) => {
        editor.destroy();
        document.body.removeChild(document.getElementById('container'));
        editor = undefined;
        document.body.innerHTML = '';
        setTimeout(() => {
            done();
        }, 750);
    });
    it('Endnote on two page', () => {
        editor.open(JSON.stringify(endNote2Page));
        expect(editor.documentHelper.pages.length).toBe(2);
        expect(editor.documentHelper.pages[1].bodyWidgets[0].childWidgets.length).toBe(0);
        expect(editor.documentHelper.pages[1].endnoteWidget).toBeDefined();
    });
    it('select all endnote', () => {
        editor.open(JSON.stringify(endNote2Page));
        editor.selection.select('0;EN;0;0;1;3', '0;EN;0;0;1;3');
        editor.selection.selectAll();
        expect(editor.selection.startOffset).toBe('0;EN;0;0;0;0');
        expect(editor.selection.endOffset).toBe('0;EN;1;0;57;7');
    });
    it('select all in body', () => {
        editor.open(JSON.stringify(endNote2Page));
        editor.selection.select('0;0;1', '0;0;1');
        editor.selection.selectAll();
        expect(editor.selection.startOffset).toBe('0;0;0');
        expect(editor.selection.endOffset).toBe('0;0;9');
    });
    it('backspace inside endnote when selection is not empty', () => {
        editor.open(JSON.stringify(endNote2Page));
        expect(editor.documentHelper.pages.length).toBe(2);
        editor.selection.select('0;EN;0;0;41;0', '0;EN;0;0;49;6');
        editor.editor.onBackSpace();
        expect(editor.documentHelper.pages.length).toBe(1);
        expect(editor.selection.startOffset).toBe('0;EN;0;0;41;0');
        expect(editor.selection.endOffset).toBe('0;EN;0;0;41;0');
    });
});
